import {
    CupideonHomeLogo, CupideonHomeSubTitle, CupideonHomeText,
    CupideonHomeTitle,
    CupideonHomeWrapper,
    CupideonLogoWrapper, CupideonStartButton, CupideonStartButtonImage,
    LoveTitle
} from "../styled/CupideonHome.styled";
import PressLogo from "../../admin/assets/logo.svg";
import StartLetter from "../assets/start.png"
import {useGoogleLogin} from "@react-oauth/google";
import {Navigate, useNavigate} from "react-router-dom";

function CupideonHome(){
    const login = useGoogleLogin({
        onSuccess: tokenResponse => {
            sessionStorage.setItem("token", tokenResponse.access_token)
            window.location.replace('http://localhost:3000/cupideon/gender');
            sessionStorage.setItem("answers", `
                {
                    "gender": ""
                }
            `)
            console.log(JSON.parse(sessionStorage.getItem("answers")))
        },
    });

    const next = () => {
        const desktop = document.getElementById("answers-desktop").value
        const mobile = document.getElementById("answers-mobile").value
        if(mobile != "undefined" || desktop != "undefined" ){
            let answer = mobile != "undefined" ? mobile : desktop
            let storage = sessionStorage.getItem("answers")
            storage = JSON.parse(storage)
            storage.gender = answer
            sessionStorage.setItem("answers", JSON.stringify(storage))
            console.log(sessionStorage.getItem("answers"))
            window.location.replace('http://localhost:3000/cupideon/classe');
        }
    }

    return(
        <CupideonHomeWrapper>
            <CupideonHomeText>
                <CupideonHomeTitle>Cupidéon</CupideonHomeTitle>
                <CupideonHomeSubTitle>Répondez à 25 questions, Cupidon trouve votre âme sœur et recevez une lettre avec son nom le jour de la Saint-Valentin !</CupideonHomeSubTitle>
                <CupideonStartButton onClick={() => login()}>
                    <CupideonStartButtonImage src={StartLetter}/>
                </CupideonStartButton>
            </CupideonHomeText>
        </CupideonHomeWrapper>
    )
}

export default CupideonHome
